import React from "react";
import { Link, Routes, Route } from "react-router-dom";

import MainPage from "./pages/main/MainPage";

function App() {
  return (
    <div>
      <h1>hihihihihihibye</h1>
      <Router>
        <Link to="/">메인</Link>
        <Route path="/" exapt={true} element={<MainPage />} />
      </Router>
    </div>
  );
}

export default App;
